import React, { Component } from 'react';
import { Header, Icon } from 'semantic-ui-react'
class HeaderTop extends Component {
    render() {
        return (
            <div>
                <Header as='h2'>
                    <Icon name='settings' />
                    <Header.Content>
                        Solither
                    <Header.Subheader>Manage your preferences</Header.Subheader>
                    </Header.Content>
                </Header>
            </div>
        );
    }
}

export default HeaderTop;
